INSERT INTO `news` (`news_id`, `title`, `date`, `description`, `image`) VALUES
(1, 'New Book Arrival', '2024-11-01', 'The library is excited to announce a fresh collection of new books arriving on November 1, 2024. This includes bestsellers in fiction, exciting new non-fiction titles, and the latest childrens books. Visit the library to explore these titles or check them out online through our catalog.', 'news-image-sample.jpg'),
(2, 'Library Renovations', '2024-11-11', 'Renovations will begin at the library on November 10, 2024, to create more modern spaces, including a new reading room and expanded digital resources area. Some sections of the library will be temporarily closed, so please plan your visits accordingly.', '2_library_renovations_20241015_111500.jpg'),
(3, 'Author Event', '2024-10-25', 'On October 25, 2024, the library will host a special event with best-selling author Jane Doe, who will discuss her latest novel, hold a Q&A session, and sign copies of her book. The event is free, but seating is limited, so registration is required.', 'news-image-sample.jpg'),
(4, 'Expanded Digital Services', '2024-10-20', 'The library is expanding its digital services starting on October 20, 2024. Patrons will have access to new e-books, audiobooks, and online learning platforms, all available through the librarys app for convenient borrowing from home.', 'news-image-sample.jpg'),
(5, 'Holiday Programs and Workshops', '2024-12-01', 'From December 1, 2024, the library will kick off its holiday season programs. This will include workshops for card making, storytelling sessions for kids, and festive cooking demonstrations for families. All events are free, and registration opens on November 15, 2024.', 'news-image-sample.jpg');
